import Menu from "./Navigation/Menu";
import Home from "./Screens/Home";
import "./App.css";

function App() {
  const width = window.innerWidth;
  const menuContainer = document.querySelector(".menuContainer")
  console.log(width);
  let classNameCtrl = "";
  if (width < 1000) {
    menuContainer.classList.remove("menus-toggle")
  }

  return (
    <div className="containerPage">
      <div className={classNameCtrl}>
        <Menu />
      </div>

      <Home />
    </div>
  );
}

export default App;
